Python command in ArcGIS Pro to export percentile lookup tables from EJScreen gdb 2023 as of 7/2023

note that INSERTUSERNAME is shown below rather than a specific actual local user name.

1) download and unzip geodatabases  

EPA EJScreen FTP site/web downloaded from here:
https://www.epa.gov/ejscreen/download-ejscreen-data
https://gaftp.epa.gov/EJScreen/2023/EJSCREEN_2023_BG_with_AS_CNMI_GU_VI.gdb.zip
https://gaftp.epa.gov/EJScreen/2023/EJSCREEN_2023_BG_StatePct_with_AS_CNMI_GU_VI.gdb.zip

unzipped as
   EJSCREEN_2023_BG_with_AS_CNMI_GU_VI.gdbv
