3) To manually copy and paste to Excel just the Field names and Alias of a table (like the full dataset),  click on attribute table and select Fields view (e.g., using right click on attrib table, Data Design, Fields) and then click in tiny upper left corner of attribute table to select all, hit ctrl-c and then in Excel ctrl-v. Paste into map_headernames.xlsx, for example, as a new tab showing the column names and their friendly aliases that some have.


4) To manually export: click on an attribute table in ArcGIS Pro and click Export data, and type to add .csv extension to the output file name to tell it to export in that format. 

Lookup tables were exported from geodatabase attribute tables to 

...\EJScreen 2023\ejscreen2023_07\usastats2023.csv
...\EJScreen 2023\ejscreen2023_07\statestats2023.csv

